INSERT INTO `privacy_rule` (`privacy_id`, `privacy_details`, `privacy_status`, `privacy_created_by`, `privacy_created_at`, `privacy_updated_by`, `privacy_updated_at`) VALUES
(1, 'Tendering is a constant bone of contention between special libraries and their parent purchasing units. Tenders are expected to offer advantages such as getting the lowest price, being fair to all possible suppliers and ensuring that the specifications of what is bought are firmly in the hands of the buyer rather than the vendor. [8] Some organisations have a requirement that suppliers have Quality Assurance certification and assessment of tenders will be different in such organisations. When buying directly from publishers, of course, all these things are irrelevant since there is only one supplier and they are not subject to any of these rules of competition. Tendering arises most often in relation to buying serials through suppliers and it is useful to explain to your financial advisers that the library is not only buying goods, but also buying services: the lowest price is only one of the things being sought. This may be outside their experience and they will find it difficult to believe. It is part of your job to convince them.', 1, NULL, '2022-09-28 17:03:16', NULL, NULL);
